ant;\r\n                                         border-right-width: 0 !important;\r\n                                       }\r\n                                     }\r\n                                   &amp;lt;/style&amp;gt;\r\n                                 &amp;lt;/head&amp;gt;\r\n                                 &amp;lt;body class=&amp;quot;&amp;quot;&amp;gt;\r\n                                  &amp;lt;table border=&amp;quot;0&amp;quot; cellpadding=&amp;quot;0&amp;quot; cellspacing=&amp;quot;0&amp;quot; class=&amp;quot;body&amp;quot;&amp;gt;\r\n                                    &amp;lt;tr&amp;gt;\r\n                                     &amp;lt;td&amp;gt;&amp;amp;nbsp;&amp;lt;/td&amp;gt;\r\n                                     &amp;lt;td class=&amp;quot;container&amp;quot;&amp;gt;\r\n                                      &amp;lt;div class=&amp;quot;content&amp;quot;&amp;gt;\r\n                                        &amp;lt;!-- START CENTERED WHITE CONTAINER --&amp;gt;\r\n                                        &amp;lt;table class=&amp;quot;main&amp;quot;&amp;gt;\r\n                                          &amp;lt;!-- START MAIN CONTENT AREA --&amp;gt;\r\n                                          &amp;lt;tr&amp;gt;\r\n                                           &amp;lt;td class=&amp;quot;wrapper&amp;quot;&amp;gt;\r\n                                            &amp;lt;table border=&amp;quot;0&amp;quot; cellpadding=&amp;quot;0&amp;quot; cellspacing=&amp;quot;0&amp;quot;&amp;gt;\r\n                                              &amp;lt;tr&amp;gt;\r\n                                               &amp;lt;td&amp;gt;'),
